    // INTERNAL HELPERS
    @inline private def lift4[T1, T2, T3, T4, R]
        (f: T1 => T2 => T3 => T4 => R,
         p1: Parsley[T1], p2: =>Parsley[T2], p3: =>Parsley[T3], p4: =>Parsley[T4]): Parsley[R] =
